INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('00925839', 'Salade de Riz à l\'ecrevisse', 'O salade avec un mélange de riz, des écrevisses, de la mangue et des pousses de pois et une sauce à la noix de coco et au piment INGRÉDIENTS Riz ariete,cuit (20%) (Riz ariete • Eau) • Riz au curcuma cuit (19%) (Riz ariete • Eau • Curcuma) • Ecrevisses cuites (Crustaces) (13%) • Sauce à la noix de coco et au piment (11 % • Mangue (7%) • Carottes • Poivrons rouges • Riz sauvage cuit (4%) : (Riz sauvage • Eau • Huile de tournesol • Roquette • Mâche • Blette rouge • Pousses de pois • Jus de citron vert • Coriandre • Sel • Poivre noir concassé • Feuilles de combava. SAUCE A LA NOIX DE COCO ET AU PIMENT contient Eau • Concentré de noix de coco , (Noix de coco • Eau) • Sucre • Huile de tournesol • Jus de citron vert • Vinaigre de vin blanc • Purée de gingembre • Citronnelle • Fécule de mai\' • Feuilles de combava • Sel • Huile de tournesol infusée au piment • Purée de piment rouge • Huile de colza • Jaune d\'œufs de poules élevées en plein air pasteurises • Curcuma • Vinaigre • Jus de citron , concentré • Cosse de moutarde • Farine de moutarde • Piments moulus. Pour les i allergènes, voir les ingrédients indiqués en gras. IMPORTANT Peut contenir des petits , fragments de carapace de crustacés. CONSEILS Secouer le pot de sauce avant d\'ouvrir. Melanger avant de servir. CONSERVATION A consommer jusqu\'au : voir sur le devant , de Ilemballage. Conserver au réfrigérateur : de OOC à +50C. Ne pas congeler. Une fois .i_ouyeg consommer dans les 24 heures.', '', '4', '0.7', '17.1', '2.7', '1', '4.4', '0.41', '0.161417322834646', '', '1');

